import React, { useState } from 'react';

const Formulario = ({ onSubmit }) => {
  const [nomeCompleto, setNomeCompleto] = useState('');
  const [email, setEmail] = useState('');
  const [telefone, setTelefone] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    const informacoesDaFatura = []; // Preencha com os dados do formulário
    onSubmit({ nomeCompleto, email, telefone, informacoesDaFatura });
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Nome Completo:
        <input type="text" value={nomeCompleto} onChange={(e) => setNomeCompleto(e.target.value)} />
      </label>
      {/* Adicione os demais campos do formulário */}
      <button type="submit">Submeter</button>
    </form>
  );
};

export default Formulario;
